import React from "react";
import InputText from "../InputMainText";
import { ButtonSelectAll } from "../ButtonSelectAll";
import { Task } from "../../types/index";

interface Props {
  onSubmit: (val: string) => void;
  onSelectBtn: () => void;
  todo: Task[];
}

const TodoForm = ({ onSubmit, onSelectBtn, todo }: Props) => {
  return (
    <div className="main_form">
      <ButtonSelectAll onSelectBtn={onSelectBtn} todo={todo} />
      <InputText value={""} onSubmit={onSubmit} />
    </div>
  );
};

export default TodoForm;
